// React Portfolio Site
import React from 'react';
import ReactDOM from 'react-dom';
import './styles.css';

const App = () => {
  return (
    <div className="app-container">
      <Header />
      <About />
      <Projects />
      <Contact />
    </div>
  );
};

export default App;
